    }}>
      <div className="leftSide">
        <Panel shaded bordered bodyFill style={{
            display: 'inline-block',
            width: "100%",
        }}>
            <Panel header="Username">

            </Panel>
        </Panel>
      </div>
      <div className="rightside">

      </div>
    </div>
  );
};

export default Home;
